import Search from "./Search";

export default function Header() {
    return (
      <nav className="navbar row">
        <div className="col-12 col-md-3 d-flex justify-content-start align-items-center">
          <div className="navbar-brand">
            <img width="80px" src="/images/logo.png" alt="Logo" />
          </div>
        </div>
        <div className="col-12 col-md-6 mt-2 mt-md-0 d-flex justify-content-center">
            <Search />
        </div>
        <div className="col-12 col-md-3 mt-4 mt-md-0 d-flex justify-content-end align-items-center">
          <span id="cart" className="ml-3">Cart</span>
          <span className="ml-1" id="cart_count">2</span>
        </div>
      </nav>
    );
  }
